import React, { useState } from "react";
import axios from "axios";

function TransactionsList() {
  const [data, setData] = useState([]);

  React.useEffect(() => {
    axios
      .get(`http://localhost:8000/transaction/`)
      .then((result) => {
        setData(result.data);
      })
      .catch((error) => {
        console.log("Error", error);
      });
  }, []);
  return (
    <div>
      {/* <button onClick={() => getData()}>Show data</button> */}
      {data?.map((item) => {
        return (
          <div>
            <h1>{item.sender_account}</h1>
            <h1>{item.receiver_account}</h1>
            <h1>{item.transaction_type}</h1>
          </div>
        );
      })}
    </div>
  );
}

export default TransactionsList;
